import { createTheme } from "@mui/system";

export const theme = createTheme({
    palette:{
        primary:{
            main: "#1760a5",
            light: "lightblue",
        },
        secondary:{
            main: "#15c630,"
        },
        otherColor:{
            main:"#999",
        }
    }
});
